INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('21e37f43-0e33-44ba-954c-708d0715d3b0', 'd8948b7c84d5e9265ef99ac80c53531c', 0, 'What Is Bladder Cancer? Bladder cancer occurs when cells in the bladder start to grow without control. The bladder is a hollow, balloon-shaped organ in the lower part of the abdomen that stores urine. The bladder has a muscular wall that allows it to get larger to store urine made by the kidneys and to shrink to squeeze urine out of the body. There are two kidneys, one on each side of the backbone, above the waist. The bladder and kidneys work together to remove toxins and wastes from your body through urine: Tiny tubules in the kidneys filter and clean the blood. These tubules take out waste products and make urine. The urine passes from each kidney through a long tube called a ureter into the bladder.', '[-0.04128558188676834,0.5678107738494873,-0.26815009117126465,-0.04872006177902222,0.09527402371168137,-0.6870535612106323,-0.510852038860321,0.503632664680481,-0.8064428567886353,-0.081462062895298,-0.1833878606557846,0.4775886833667755,0.5967258810997009,1.113490343093872,-1.729331135749817,-0.2665162980556488,0.4862439036369324,0.07339811325073242,-0.1350618153810501,-1.1103495359420776,0.09852343797683716,-0.38639310002326965,-0.6912264227867126,0.5239512324333191,0.5917474627494812,0.15009523928165436,-0.2441283017396927,-0.16858215630054474,-0.13461549580097198,-0.3977634012699127,-0.5751650333404541,-0.3360973596572876,1.1852480173110962,0.34810391068458557,0.9837470054626465,-0.07802604138851166,-0.005350065883249044,0.4319104850292206,-0.5160343050956726,0.4903090000152588,0.3116592466831207,-0.883030354976654,-0.173092320561409,-0.8566115498542786,0.3108479380607605,-0.33319276571273804,-0.06952614337205887,-0.10220970213413239,0.7537968158721924,1.3134745359420776,-1.1373299360275269,-0.7769970297813416,-0.7895301580429077,0.6144697070121765,-0.0031829301733523607,-0.