INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('864be868-1516-4cb2-9ebe-d8b905330732', 'd2bbade8d96190c566bc466ec80c094d', 0, 'panel) showing the kidneys, ureters, bladder, and urethra. The inside of the left kidney shows the renal pelvis. An inset shows the renal tubules and urine. Also shown are the prostate and penis (left panel) and the uterus (right panel). Urine is made in the renal tubules and collects in the renal pelvis of each kidney. The urine flows from the kidneys through the ureters to the bladder. The urine is stored in the bladder until it leaves the body through the urethra. Types of bladder cancer Urothelial carcinoma (also called transitional cell carcinoma) is cancer that begins in the urothelial cells, which line the urethra, bladder, ureters, renal pelvis , and some other organs. Almost all bladder cancers are urothelial carcinomas.', '[0.11626625061035156,0.535284698009491,-0.18939825892448425,0.012481260113418102,0.26121658086776733,-0.4226473271846771,-0.24049893021583557,0.5231150388717651,-0.9309147596359253,-0.1623576432466507,-0.11385123431682587,0.47384947538375854,0.8398988246917725,0.5576309561729431,-1.3967231512069702,-0.09112973511219025,0.689473032951355,0.002084480132907629,0.09157305955886841,-1.0318089723587036,0.31573551893234253,-0.2366340011358261,-0.8144308924674988,0.24446937441825867,0.35785922408103943,0.15313030779361725,-0.42804020643234253,-0.05594803765416145,-0.4625305235385895,-0.5253317952156067,-0.4999501407146454,-0.1537753790616989,1.2080906629562378,-0.49310484528541565,0.6924393773078918,-0.14530937373638153,-0.2091541886329651,0.6261091232299805,-0.9608892798423767,0.48925143480300903,0.3516547977924347,-0.5435304641723633,0.19300080835819244,-0.5129954814910889,0.9349156022071838,-0.19114066660404205,0.1559622883796692,0.07536961883306503,0.2978556454181671,1.0704838037490845,-1.12435781955719,-0.7038765549659729,-0.6678720712661743,0.42120826244