INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('67f326cb-34b1-435e-b7c9-1fe9b6dd7801', 'f68439b69675933581bc126bc68af168', 0, 'cell carcinoma is cancer that begins in squamous cells (thin, flat cells lining the inside of the bladder). This type of cancer may form after long-term irritation or infection with a tropical parasite called schistosomiasis, which is common in Africa and the Middle East but rare in the United States. When chronic irritation occurs, transitional cells that line the bladder can gradually change to squamous cells. Adenocarcinoma is cancer that begins in glandular cells that are found in the lining of the bladder. Glandular cells in the bladder make mucus and other substances. Small cell carcinoma of the bladder is cancer that begins in neuroendocrine cells (nerve-like cells that release hormones into the blood in response to a signal from the nervous system).', '[0.1351066380739212,0.1426813304424286,-0.24446697533130646,-0.18347284197807312,0.06469037383794785,-0.33609992265701294,-0.6356471180915833,0.1984868049621582,-0.33123520016670227,0.2208368182182312,-0.141679584980011,0.14546574652194977,0.4160241484642029,0.422454297542572,-1.43033766746521,-0.3963519334793091,0.3458358347415924,0.3822254538536072,0.9018313884735107,-1.1981825828552246,-0.028204692527651787,-0.026289023458957672,-0.21478264033794403,0.44369110465049744,-0.3043764531612396,-0.0677591934800148,0.024708217009902,-0.11969885975122452,-0.11806975305080414,0.13396865129470825,-0.6180185079574585,-0.3308871388435364,1.0235220193862915,-0.02025405503809452,0.7531076669692993,0.44481155276298523,0.30424565076828003,0.5978362560272217,-1.3465664386749268,0.1347404271364212,0.26344093680381775,-0.7707911729812622,-0.6454309225082397,-0.09422222524881363,0.32108619809150696,-0.3694193363189697,-0.14923252165317535,-0.22080393135547638,0.6477633118629456,0.9262503981590271,-0.5461715459823608,-0.5978054404258728,-0.46