INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('05792dd5-a7bd-4adf-ac51-885edf886461', '1ebaeb8abc9cccea5e90005e871eb04a', 0, 'Cancer that starts in the liver is called primary liver cancer. The most common type of primary liver cancer in adults is hepatocellular carcinoma (HCC). This type of liver cancer is the third leading cause of cancer-related deaths worldwide. Primary liver cancer can occur in both adults and children. However, treatment for children is different than treatment for adults. Bile duct cancer, also called cholangiocarcinoma, is cancer that starts in the bile ducts, which are tubes that connect the liver and gallbladder to the small intestine. Cancer that forms in the bile ducts inside the liver is called intrahepatic bile duct cancer. If it forms in the bile ducts outside of the liver it is called extrahepatic bile duct cancer.', '[-0.08109670877456665,-0.17352096736431122,0.33230504393577576,0.49587488174438477,-0.3078504204750061,-0.15579204261302948,0.0006742267869412899,-0.06749451160430908,-0.4467526972293854,0.908900260925293,0.23421044647693634,0.20336425304412842,0.19101908802986145,-0.04397027567028999,-0.8040853142738342,-0.5005610585212708,0.1311892718076706,0.7461842894554138,0.5497341156005859,-0.8407227993011475,0.005649156868457794,-0.6045189499855042,-0.33456459641456604,0.2131412923336029,-1.243761420249939,0.015214947983622551,-0.44711971282958984,-0.3001668453216553,-1.1110652685165405,-0.8107603788375854,-0.35735276341438293,0.3177867829799652,-0.04773353785276413,-0.4425082206726074,-0.3347812592983246,0.35162562131881714,0.14607641100883484,0.7036494612693787,-0.04367702081799507,-0.238895446062088,0.3989119529724121,-1.0258899927139282,0.0007894220761954784,-0.13072122633457184,0.37333717942237854,-9.922186291078106e-05,-0.023867128416895866,-0.08134062588214874,0.14324353635311127,0.0780935138463974,-0.3062707781791687,0.21238048374652863,0.053017258644104004,0