INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('8e88c8c8-3631-4231-9183-cfb5ba400d0c', 'ac1294dd6d09652cbef4f187e9ab0e20', 0, 'What Is Cervical Cancer? Cervical cancer is cancer that starts in the cells of the cervix. The cervix is the lower, narrow end of the uterus (womb). The cervix connects the uterus to the vagina (birth canal). Cervical cancer usually develops slowly over time. Before cancer appears in the cervix, the cells of the cervix go through changes known as dysplasia, in which abnormal cells begin to appear in the cervical tissue . Over time, if not destroyed or removed, the abnormal cells may become cancer cells and start to grow and spread more deeply into the cervix and to surrounding areas. Enlarge Anatomy of the female reproductive system. The organs in the female reproductive system include the uterus, ovaries, fallopian tubes, cervix, and vagina.', '[0.15247732400894165,0.2148016095161438,0.06488408148288727,0.5644533038139343,-0.38175660371780396,0.29950621724128723,-0.2670270502567291,-0.050168056041002274,0.5476824045181274,0.41732028126716614,-0.3589939475059509,0.1319756656885147,-0.06734445691108704,-0.6841989755630493,-0.5175132751464844,-0.46914198994636536,0.06980984658002853,0.40001919865608215,0.7908751964569092,-1.2230398654937744,-0.2912827134132385,0.670863926410675,-0.7462226748466492,0.6068959832191467,-0.7075651288032532,-0.2796969711780548,-0.6583104133605957,0.7292190194129944,-0.20725633203983307,0.14104612171649933,-0.3654254376888275,0.2768675684928894,0.2434740662574768,0.04365193843841553,0.4929296374320984,0.42030590772628784,-0.4832139313220978,0.6418126225471497,-0.573610782623291,0.05648829787969589,0.14235861599445343,-0.9692316055297852,-0.4788699150085449,0.009475257247686386,0.6475313305854797,0.3260264992713928,0.12903571128845215,-0.4758640229701996,0.31500425934791565,0.21386177837848663,-0.3191400170326233,-0.25398075580596924,-0.5531627535820007,0.