INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('0ca0bdaf-f485-425e-a566-679b49bbf4ed', '8cfe21678bfc0b976d981112bb054417', 0, 'and ectocervix meet is called the squamocolumnar junction, which contains both glandular cells (column-shaped cells that make mucus) from the endocervix and squamous cells (thin, flat cells) from the ectocervix. The squamocolumnar junction is sometimes referred to as the transformation zone. Types of cervical cancer Cervical cancers are named after the type of cell where the cancer started. The two main types are: Squamous cell carcinoma : Most cervical cancers (up to 90%) are squamous cell carcinomas. These cancers develop from cells in the ectocervix. Adenocarcinoma : Cervical adenocarcinomas develop in the glandular cells of the endocervix. Clear cell adenocarcinoma, also called clear cell carcinoma or mesonephroma, is a rare type of cervical adenocarcinoma.', '[0.28700387477874756,0.2708379626274109,-0.41212788224220276,0.12549105286598206,-0.23193196952342987,0.049237772822380066,-0.7510706782341003,-0.33169591426849365,0.5022842288017273,0.2233922928571701,-0.21645991504192352,0.3419451415538788,-0.007042613811790943,-0.14414082467556,-0.4515056312084198,-0.6216602921485901,0.5137746930122375,0.5860413312911987,1.0125784873962402,-0.9862480759620667,0.13859324157238007,0.39060258865356445,-0.1645110547542572,-0.3763819634914398,-0.3647850453853607,0.1657513827085495,-0.6467257142066956,0.09470929205417633,-0.595665693283081,-0.7513323426246643,-0.276131272315979,-0.25989437103271484,0.7235389351844788,-0.7390912771224976,0.1474093347787857,0.5338029265403748,-0.5289129018783569,-0.05400114879012108,-1.2868460416793823,-0.18240714073181152,0.596316933631897,-0.4265255928039551,-0.678229808807373,0.21064113080501556,0.3465431332588196,0.26339197158813477,0.4573613405227661,-0.9418774843215942,0.6258344054222107,0.427942156791687,-0.2301444113254547,-0.05687751993536949,-0.4275