INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('39174249-06ad-4104-a853-663db547191c', 'b3970b16961a340220a757de99b2459b', 0, 'Cardiovascular disease can refer to a number of conditions: Heart disease Heart and blood vessel disease, also called heart disease , includes numerous problems, many of which are related to atherosclerosis . Atherosclerosis is a condition that develops when a substance called plaque builds up in the walls of the arteries. This buildup narrows the arteries, making it harder for blood to flow through. If a blood clot forms, it can block the blood flow. This can cause a heart attack or stroke. Heart attack A heart attack occurs when the blood flow to a part of the heart is blocked by a blood clot. If this clot cuts off the blood flow completely, the part of the heart muscle supplied by that artery begins to die.', '[0.18121473491191864,0.5960690379142761,0.20439867675304413,0.18353979289531708,0.06853976845741272,0.3559741675853729,0.842401921749115,0.3790515959262848,-0.6558403968811035,-0.4528455436229706,0.2256755232810974,0.9071491956710815,-0.4588395357131958,-0.6360726952552795,-0.027475863695144653,0.15580235421657562,-0.08665832132101059,0.21055778861045837,-0.004244830925017595,0.002217912580817938,-0.22850994765758514,-0.035214126110076904,-0.3824937045574188,0.2999170422554016,0.02063632197678089,0.14101797342300415,-0.875311017036438,-0.32590627670288086,-0.4461994171142578,-0.020155640318989754,-0.3494042754173279,-0.4149344861507416,-0.0829765796661377,0.4005527198314667,-0.1052200198173523,-0.33487915992736816,-0.011305912397801876,0.6448646187782288,-0.1527465581893921,0.21022535860538483,-0.3006066381931305,-0.10651184618473053,0.36593514680862427,0.34908339381217957,0.09404126554727554,-0.4158605635166168,-0.029794879257678986,0.3620886504650116,-0.04480776935815811,0.5977264046669006,-0.8863910436630249,-0.5201005339622498,-0.7454333901405334,0.27284806966781616,0