INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('ffe5b70b-d782-4680-9a11-09060f84d0bc', 'bb23b159e272c9c2bf8ec3e05263fcaf', 0, 'are various types of arrhythmias. The heart can beat too slow, too fast or irregularly. Bradycardia , or a heart rate that’s too slow, is when the heart rate is less than 60 beats per minute. Tachycardia , or a heart rate that’s too fast, refers to a heart rate of more than 100 beats per minute. An arrhythmia can affect how well your heart works. With an irregular heartbeat, your heart may not be able to pump enough blood to meet your body’s needs. Learn more about arrhythmia . Heart valve problems When heart valves don’t open enough to allow the blood to flow through as it should, a condition called stenosis results. When the heart valves don’t close properly and thus allow blood to leak through, it’s called regurgitation .', '[-0.283237099647522,-0.005919629242271185,-0.199485644698143,0.14692363142967224,0.11673834174871445,0.6031321883201599,0.36084574460983276,0.006268251687288284,-0.3207423985004425,-0.7920932769775391,0.9911038279533386,0.9793870449066162,-0.28076067566871643,-0.39586007595062256,-0.4522917568683624,0.12804915010929108,0.20661917328834534,0.13007852435112,0.22891868650913239,-0.21817085146903992,-0.013543114066123962,-0.29840511083602905,-0.4914161264896393,0.7372090220451355,0.9865737557411194,0.4414450228214264,-0.5733407735824585,-0.6472864747047424,-0.36938753724098206,0.09549851715564728,-0.9917633533477783,-0.10980989038944244,0.0870283916592598,0.6587314605712891,0.17038068175315857,-0.4362984597682953,-0.059641607105731964,0.7111305594444275,0.2674051821231842,-0.5409175157546997,-0.1625119298696518,-0.6314907073974609,-0.24538616836071014,-0.6244238615036011,0.026797832921147346,-0.351888507604599,0.12428882718086243,0.11950928717851639,-0.45450618863105774,0.8923145532608032,-0.8556912541389465,-0.5984524488449097,-0.5996913909912109,0.32662841677