INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('ff714c49-ba86-4c07-bfda-0146956ef9e8', 'e23b2429578bf4b614b7e7811a2f2539', 0, 'What is cardiac rehabilitation? Cardiac rehabilitation doesn’t change your past, but it can help you improve your heart’s future. Cardiac rehab is a medically supervised program designed to improve your cardiovascular health if you have experienced heart attack, heart failure, angioplasty or heart surgery. Learn more about cardiac rehab How Will I Benefit from Cardiac Rehab? Managing Your Medications Taking Care of Yourself Support That Empowers Recovery becomes so much more manageable when you have the right kind of emotional support. Our online community of patients, survivors and caregivers is here to keep you going no matter the obstacles. We’ve been there, and we won’t let you go it alone. Find encouragement Play without Auto-Play Play Video Your Heart Surgery: Rehab and Recovery', '[-0.7046235203742981,0.22369471192359924,-0.3026304543018341,-0.5137913227081299,-0.40275830030441284,0.4328180253505707,0.016030387952923775,0.02042737603187561,-0.9906576871871948,-0.09858117252588272,0.39152926206588745,0.7984732389450073,-0.15503591299057007,-0.3911953568458557,0.20173586905002594,-0.23402011394500732,0.2709963321685791,-0.4369829297065735,-0.2338183969259262,0.07633719593286514,-0.6197074055671692,-0.06334317475557327,-0.35108521580696106,0.2636014223098755,0.45170778036117554,0.13396507501602173,-0.1468021720647812,-0.40346965193748474,0.5296030640602112,0.3015500605106354,-0.6986035704612732,1.0964192152023315,-0.4409934878349304,1.1997617483139038,0.5238027572631836,-0.3587968945503235,-0.4194563031196594,0.05186400189995766,0.22025282680988312,-0.3618793785572052,0.3407692015171051,0.11382970958948135,-0.27184775471687317,-0.12679056823253632,-0.17684262990951538,-0.590093195438385,-0.4819832742214203,0.11564838886260986,-0.5113843679428101,0.23447853326797485,-0.53004682