INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('36248e03-f163-4b80-8d91-d80ff69ba50a', 'e35b6821a2761b73bc3b9ce1a187968a', 0, 'What Is An Arrhythmia? The term “arrhythmia” refers to any problem in the rate and/or rhythm of a person’s heartbeat. During an arrhythmia, changes in heart tissue and activity, or in the heart’s electrical impulses, may cause the heartbeat to be too fast, too slow or erratic. This is known as an irregular heartbeat. Learn more about arrhythmia Tachycardia: Fast Heart Rate Symptoms, Diagnosis and Monitoring of Arrhythmia Prevention and Treatment of Arrhythmia Support That Empowers Recovery becomes so much more manageable when you have the right kind of emotional support. Our online community of patients, survivors and caregivers is here to keep you going no matter the obstacles. We’ve been there, and we won’t let you go it alone.', '[-0.41975700855255127,0.04453803598880768,-0.270256370306015,-0.3290258049964905,-0.25979313254356384,0.5632947683334351,0.16387838125228882,-0.4550580680370331,-0.44585880637168884,-0.6612803339958191,0.6288778185844421,0.9324738383293152,-0.04773453623056412,-0.13634727895259857,0.20112194120883942,-0.285177618265152,0.3572036325931549,-0.24834170937538147,0.09660321474075317,-0.22277969121932983,-0.6558002233505249,-0.38307902216911316,-0.6720721125602722,1.082234263420105,0.5890005826950073,-0.10591550171375275,-0.7590058445930481,-0.6305519938468933,0.023819444701075554,0.34529536962509155,-1.0524555444717407,-0.100387342274189,0.043968670070171356,0.829521894454956,0.33123689889907837,-0.30568134784698486,-0.07742273807525635,0.45678961277008057,-0.3595046401023865,-0.3171685039997101,-0.20676177740097046,0.04949156194925308,-0.6532407999038696,-0.2202160656452179,-0.3351230323314667,-0.2946622967720032,-0.18869419395923615,0.48309028148651123,-0.16556812822818756,0.8843488097190857,-0.6798476576805115,-0.7569096684455872,-0.4243702292442322,0.23