INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('d712ff2f-0a1e-4d7d-8362-6571cc6295b8', 'd09ec9c4a7200eb30c45067da1a653c3', 0, 'What is Peripheral Artery Disease? Peripheral artery disease, or PAD, is a narrowing of the inside of the peripheral arteries that carry blood away from the heart to other parts of the body. The most common type is lower-extremity PAD, in which blood flow is reduced to the legs and feet. Learn more about PAD Symptoms of PAD Prevention and Treatment of PAD PAD Resources Watch video What you should know about PAD Watch video Are you at risk for PAD? Watch video What you can do to prevent PAD Watch video Six simple steps you can take to treat PAD at home Watch video Señales de advertencia de EAP Why PAD Matters Left untreated, PAD can lead to limb amputation, coronary artery disease, heart attack and stroke.', '[-0.08183963596820831,0.06670831143856049,-0.1967124342918396,-0.06699864566326141,0.25123900175094604,0.4503582715988159,0.23649707436561584,-0.04549194499850273,0.16298727691173553,-0.7782757878303528,-0.7279008626937866,0.3827856183052063,0.1396828144788742,-0.9540796279907227,-0.1865469217300415,0.11484186351299286,-0.3400026857852936,-0.17083397507667542,-0.4486711919307709,0.2874709367752075,-1.0828510522842407,-0.46543553471565247,-0.03963392227888107,0.10474321991205215,0.28066831827163696,0.08060122281312943,-0.5283163785934448,0.2872873544692993,0.3353075087070465,-0.14776276051998138,0.15735246241092682,-0.20389893651008606,0.17070570588111877,-0.470831960439682,-0.2113468050956726,-0.4514281749725342,-0.2677168846130371,0.528703510761261,0.7193030714988708,0.3403744101524353,0.08831343799829483,0.4935326874256134,-0.19692778587341309,-0.13886414468288422,0.14911885559558868,0.5168115496635437,-0.3279295563697815,1.2230281829833984,-0.04224182292819023,0.12802141904830933,-1.052315354347229,-0.011247429065406322,-0.0038861832581460476,0.3109510540962219,0.6686799526