INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('dc7bbfc9-9243-48fe-bec5-9a21bd80b836', '657f292c60299df9be717c5f214297ab', 0, 'What does it mean to eat healthy? The answer is a little different for everybody, but it’s a delicious journey to find out what works best for you. Here’s where you can start to navigate nutrition and the science-backed facts about food. Image Healthy Eating Can Be Delicious! Healthy eating for prediabetes and diabetes not only helps to manage your blood glucose (blood sugar), but it also helps you have a better relationship with food. Intentional food choices like eating more non-starchy veggies, opting for lean meats or plant-based proteins, choosing quality carbohydrates, and low-fat versions of cheeses and dressings, will all help you meet your health goals—and they’ll taste great too! It is not about one food, or one meal, it’s about healthy eating over time.', '[-0.14921753108501434,-0.5009322166442871,-0.3710484504699707,-0.22480133175849915,0.6025754809379578,0.33279600739479065,-0.41943132877349854,0.4759397506713867,0.5358381271362305,0.40646636486053467,0.3783557415008545,0.4627465605735779,-0.19942514598369598,-0.9184586405754089,-1.1575934886932373,-0.5023778080940247,-0.6293429732322693,0.3565903902053833,-1.1281543970108032,-0.5575908422470093,-0.38810592889785767,0.44528812170028687,-0.02874385565519333,-0.37791162729263306,0.6094266772270203,-0.3685699999332428,-0.25578027963638306,-0.8440667986869812,0.26830992102622986,0.18952292203903198,-0.7737826704978943,0.24682997167110443,0.19580811262130737,0.14958152174949646,-0.43432626128196716,-0.3097386062145233,-0.10990224778652191,0.8486876487731934,0.8175770044326782,-0.8886726498603821,-0.17994213104248047,0.9322928190231323,0.23324158787727356,0.6615679860115051,-0.6746237874031067,0.07325081527233124,0.36464759707450867,-0.4337465465068817,0.34291213750839233,0.0017027754802256823,-0.6020887494087219,-0.4589821